import React, { Component } from 'react';
import './App.scss';

import Winners from './Components/Winners';


class App extends Component {
  render() {
    return (
      <div className="c-app">
        <div className="header">
        <img className="logo-fusee" src={process.env.PUBLIC_URL+'/assets/images/logo_fusee.png'} alt="Logo Smile" />
        </div>
        <div className="main">
          <h1>Breakfast time !</h1>
          <h2>And the winners are ...</h2>
         {/* <Winners /> */}
        </div>
      </div>
    );
  }
}

export default App;
